import React from "react";
import Graphic from "../graphic/graphic";

const Home = () => {
  const gaz_data = [
    { data: new Date(10, 10, 2020), value: 10 },
    { data: new Date(11, 10, 2020), value: 13 },
    { data: new Date(12, 10, 2020), value: 6 },
  ];
  const apa_data = [
    { data: new Date(10, 10, 2020), value: 30 },
    { data: new Date(11, 10, 2020), value: 53 },
    { data: new Date(12, 10, 2020), value: 60 },
  ];
  return (
    <div>
      <Graphic title={"gaz"} data={gaz_data} />
      <Graphic title={"apa"} data={[]} />
    </div>
  );
};

export default Home;
